// import validate from './Validation';
import React, { useEffect } from 'react';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Link } from 'react-router-dom';
export default function Form(props){


const navigate =useNavigate()
const [nuevaPalabra, setNuevaPalabra] = useState('');
const [listaPalabras, setListaPalabras] = useState([]);
const [resultado, setResultado] = useState('');
const [newDog,SetNewDog] = useState({})
const agregarPalabra = () => {
    if (nuevaPalabra.trim() !== '') {
      setListaPalabras([...listaPalabras, nuevaPalabra]);
      setNuevaPalabra('');
    
    }
  };
  const concatenarPalabras = () => {
    const resultadoConcatenado = listaPalabras.join(', ');
    setResultado(resultadoConcatenado);
  };
function HandleOnChange (e){
    const nombre = e.target.name;
        const valor = e.target.value;


    SetNewDog({...newDog,[nombre]: e.target.value});
  
    // setErrors(validate({...userData,[nombre]: e.target.value}))
    // 
}

const handleSubmit = event => {
    event.preventDefault();
    console.log("Objeto de newDog:", JSON.stringify(newDog, null, 2));
    props.postNewDog(newDog);
  }
useEffect(()=>{console.log("el resultado es "+ listaPalabras)})

return (
<form onSubmit={handleSubmit}
>
<label style={{color:"black",fontSize:"1em"}}>Nombre Raza : </label> <input style={{fontSize:"1em"}} name="name" onChange={HandleOnChange}></input>
<label style={{color:"black",fontSize:"1em"}} >    Altura Mínima: </label> <input name="maxHeight"  onChange={HandleOnChange}></input>
<label style={{color:"black",fontSize:"1em"}} >    Altura Máxima: </label> <input name="minHeight"  onChange={HandleOnChange}></input>
<label style={{color:"black",fontSize:"1em"}} >    Peso Máximo: </label> <input name="weightMax"  onChange={HandleOnChange}></input>
<label style={{color:"black",fontSize:"1em"}} >    Peso Minimo: </label> <input name="weightMin"  onChange={HandleOnChange}></input>
<label style={{color:"black",fontSize:"1em"}} >    url Imagen: </label> <input name="reference_image_id"  onChange={HandleOnChange}></input>
<label style={{color:"black",fontSize:"1em"}} >    Años de vida: </label> <input name="spanLife"  onChange={HandleOnChange}></input>
<h3>Lista de Palabras:</h3>
        <ul>
          {listaPalabras.map((palabra, index) => (
            <li key={index}>{palabra}</li>
          ))}
        </ul>
<input
          type="text"
          value={nuevaPalabra}
          onChange={(e) => setNuevaPalabra(e.target.value)}
        />
        <button onClick={agregarPalabra}>Agregar Palabra</button>

<hr style={{margin:"15px"}}></hr>   

<div>
        <button onClick={concatenarPalabras}>Concatenar Palabras</button>
      </div>
<button type="submit" style={{margin:"5px"}} onClick={handleSubmit}> Enviar </button>
<br></br>
<Link to="/nuevousuario"> <button  style={{margin:"5px"}} > Registrarse </button> </Link> 
</form>


)
// {/* <a1 style={{color:"red"}}>{error.email ? error.email: null} </a1>
// <a1 style={{color:"red"}}>{error.password ? error.password: null} </a1> */}
}
